import React from "react";
import Selector from "./Selector";

function Selectores(){

    const equipos = ["Real Madrid", "FC Barcenlona"];
    const arbitos = ["Pepito", "Juanito"];

    return(
        <div className="row">
            <div className="col-lg-4 g-5">
                <Selector data = { equipos }></Selector>
            </div>
            <div className="col-lg-4 g-5">
                <Selector data = { equipos }></Selector>
            </div>
            <div className="col-lg-4 g-5">
                <Selector data = { arbitros }></Selector>
            </div>
        </div>
    )

}

export default Selectores;
